 import React from 'react';
import History from '../history/history'
import {NavLink} from 'react-router-dom';
import h from './header.module.css';
 const Header = (props)=> {
     console.log(props.myTask);
     
    return (
        <div className={h.container}>
            <div className={h.item__container} >
                    {props.myTask.length? <div><img className={h.icon} src="https://img.icons8.com/color/48/000000/high-importance--v1.png"/></div>:null}
                    <div className={h.NavLink}><NavLink to='/active' activeClassName=''>  Мои дела </NavLink> </div>
            </div>
               </div>
     )
 }

 export default Header;
